import React from "react";
import "./css/style.css";
import "./css/bootstrap.min.css";
import "./css/animate.css";
import "./css/animate.min.css";
import "./App.css";
import Header from "./components/common/Header";
import { Route, BrowserRouter as Router, Routes, Navigate } from "react-router-dom";
import {
  Home,
  Booking,
  AboutUs,
  Contact,
  PageNotFound,
  Room,
  Services,
  Team,
  Testimonial,
  ReservasActivas,
} from "./pages/index";
import Footer from "./components/common/Footer";
import RoomDetails from "./components/RoomDetails";
import Login from "./components/Login";  // Componente de login
import Dashboard from "./components/Dashboard";  // PÃ¡gina protegida
import ProtectedRoute from "./ProtectedRoute";  // Para proteger las rutas

export default function App() {
  const token = localStorage.getItem("token");

  return (
    <>
      <div className="app-container">
        <Router>
          <Header />
          <div className="content-container">
            <Routes>
              {/* Ruta de login */}
              <Route path="/login" element={<Login />} />

              {/* Redirigir al login si no hay token al intentar acceder a la pÃ¡gina principal */}
              <Route
                path="/"
                element={token ? <Home /> : <Navigate to="/login" replace />}
              />

              {/* Proteger rutas adicionales */}
              <Route
                path="/booking"
                element={
                  <ProtectedRoute>
                    <Booking />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/ReservasActivas"
                element={
                  <ProtectedRoute>
                    <ReservasActivas />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/team"
                element={
                  <ProtectedRoute>
                    <Team />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/testimonial"
                element={
                  <ProtectedRoute>
                    <Testimonial />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/about"
                element={
                  <ProtectedRoute>
                    <AboutUs />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/contact"
                element={
                  <ProtectedRoute>
                    <Contact />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/rooms"
                element={
                  <ProtectedRoute>
                    <Room />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/services"
                element={
                  <ProtectedRoute>
                    <Services />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/room/:id"
                element={
                  <ProtectedRoute>
                    <RoomDetails />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/dashboard"
                element={
                  <ProtectedRoute>
                    <Dashboard />
                  </ProtectedRoute>
                }
              />

              {/* Ruta para pÃ¡gina no encontrada */}
              <Route path="/*" element={<PageNotFound />} />
            </Routes>
          </div>
          <Footer />
        </Router>
      </div>
    </>
  );
}
